import dayjs from 'dayjs';
import weekday from "dayjs/plugin/weekday"
import localeData from "dayjs/plugin/localeData"
import 'dayjs/locale/zh-cn';

export function getStartParams() : any {
  let argsObject : any = {};
  if ('electron' in window) {
    let args = window.electron.getAdditionalArguments()
    .map(arg => atob(arg))
    .map(arg => arg.split("="));
    for (let arg of args) {
        argsObject[arg[0]] = arg[1];
    }
  }
  return argsObject;
}

export function paramToString(obj) {
  let ret = "";
  if (Object.keys(obj).length > 0) {
    for (let _key in obj) {
      ret += _key + "=" + obj[_key] + "&"
    }
    ret = ret.substring(ret, ret.length - 1);
  }
  return ret;
}

export function substr(str : any, length : number) {
  if (str != null && str.length > length) {
    return str.substring(0, length) + "...";
  }
  return str;
}

export function paramToLines(params : Array<any>, length : number) {
  let ret = "";
  for (let key in params) {
    let value = ""
    if (!isStringEmpty(params[key])) {
      value = params[key].substring(0, length)
    }
    ret += key + "=" + value + "\n"
  }
  return ret;
}

export function isStringEmpty(str) {  
  return str === null || str === undefined || str.trim() === '';  
}

export function isNumeric(str) {
  return /^-?\d+(\.\d+)?$/.test(str);
}

export function getMapValueOrDefault(map : Map<string, string>, key : string, defaultValue : string) : string {
  return map.get(key) || defaultValue;
}

export function moveKeyValListByKey(keyValList, targetKey) {

  // 找到目标元素
  const targetElement = keyValList.find(item => item.key === targetKey);

  // 移除目标元素并重新构建数组
  const updatedArray = [targetElement, ...keyValList.filter(item => item.key !== targetKey)];

  return updatedArray;
}

export function getNowdayjs() : dayjs.Dayjs {
  dayjs.locale('zh-cn'); 
  dayjs.extend(weekday)
  dayjs.extend(localeData)
  return dayjs();
}

export function getdayjs(timestamp : number) : dayjs.Dayjs  {
  dayjs.locale('zh-cn'); 
  dayjs.extend(weekday)
  dayjs.extend(localeData)
  return dayjs(timestamp);
}

export function getType(obj : any) {
  return Object.prototype.toString.call(obj).slice(8, -1);  
}

export function removeWithoutGap(arr : Array<Object>, index : number) {  
  // 确保索引在数组范围内  
  if (index >= 0 && index < arr.length) {  
      // 使用后面的元素覆盖要删除的元素  
      for (let i = index; i < arr.length - 1; i++) {  
          arr[i] = arr[i + 1];  
      }  
      // 减少数组长度以删除最后一个元素（它现在是多余的）  
      arr.length--;  
  }  
  return arr;  
}

export function isJsonString(str : string) : boolean {
  if (getType(str) !== "String") return false;
  if (!str) return false;
  try {
      JSON.parse(str);
  } catch (e) {
      return false;
  }
  if (str.substring(0, 1) !== "{" && str.substring(0, 1) !== "[") {
      return false;
  }
  return true;
}

