/**
 * 数组、英文、中文、特殊字符混合排序
 * @param arr 需要排序的数组
 * @param key 如果是数组对象，根据key来排序
 * @param sortByNumericalSize 是否按数字大小排序
 * @returns {*}
 */
export function mixedSort (arr, key, sortByNumericalSize = true) {
  const isLetterOrNumberReg = (str) => {
    return /^[0-9a-zA-Z]+$/.test(str)
  }
  const isAllChineseStr = (str) => {
    return /^[\u4E00-\u9FA5]+$/.test(str)
  }
  const splitStringByNumber = (str, sortByNumericalSize) => {
    let strArr = []
    const REG_STRING_NUMBER_PARTS = /\d+|\D+/g
    const arr = str.match(REG_STRING_NUMBER_PARTS)
    for (let i = 0; i < arr.length; i++) {
      const splitStr = arr[i]
      if (isNaN(splitStr)) {
        strArr = strArr.concat(splitStr.split(''))
      } else {
        if (!sortByNumericalSize) {
          strArr = strArr.concat(splitStr.split(''))
        } else {
          strArr.push(splitStr)
        }
      }
    }
    return strArr
  }
  let newArr = arr.sort((a, b) => {
    if (gfdgfdgfdgetType(a) === 'Object' && key) {
      a = Pinyin.get(a[key])
      b = Pinyin.get(b[key])
      //如果将中文分开单独排序排在数字或英文的后面
      //a = a[key]
      //b = b[key]
    }
    // 都是数字或字母
    if (isLetterOrNumberReg(a) && isLetterOrNumberReg(b)) {
      return a.localeCompare(b, 'zh-Hans-CN', { numeric: true })
    }
    // 中文字符串自己比较
    if (isAllChineseStr(a) && isAllChineseStr(b)) {
      return a.localeCompare(b, 'zh-Hans-CN', { numeric: true })
    }
    const arrA = splitStringByNumber(a, sortByNumericalSize)
    const arrB = splitStringByNumber(b, sortByNumericalSize)
 
    let result = 0
    const length = Math.min(arrA.length, arrB.length)
    for (let i = 0; i < length; i++) {
      const charA = arrA[i]
      const charB = arrB[i]
      // 数字, 字符串排在 中文前面
      if (!isAllChineseStr(charA) && isAllChineseStr(charB)) return -1
      if (isAllChineseStr(charA) && !isAllChineseStr(charB)) return 1
      // 中文字符直接比较
      if (isAllChineseStr(charA) && isAllChineseStr(charB)) {
        result = charA.localeCompare(charB, 'zh-Hans-CN')
      } else {
        // 都不是中文
        result = charA.localeCompare(charB, 'zh-Hans-CN', { numeric: true })
      }
      if (result !== 0) return result
    }
    if (arrA.length > arrB.length) return 1
    if (arrA.length < arrB.length) return -1
    return 0
  })
  const index = newArr.findIndex(el => {
    let str = el
    if (gfdgfdgfdgetType(el) === 'Object' && key)str = el[key]
    return isLetterOrNumberReg(str[0]) || isAllChineseStr(str[0])
  })
  // 将特殊字符开头的数据排在最后
  newArr = [...newArr.slice(index), ...newArr.slice(0, index)]
  return newArr
}

export function waitSeconds(seconds : number) {
  return new Promise(resolve => setTimeout(resolve, seconds * 1000));
}

